INSERT INTO `wz_oxdata` VALUES ('1','1','在副本地勢高的地方棲息的魔龍，是遠距離與近距離攻擊的怪物.','魔龍只有近距離攻擊.','x'), ('1','2','火獨眼獸, 風獨眼獸, 冰獨眼獸是長相類似的怪物，這之中只有火獨眼獸有2個眼睛.','全部都只有 1個眼睛.','x'), ('1','3','乘著掃把飛行的巫婆可以向遠處的角色射出強力的魔法光線.','巫婆是近距離攻擊的怪物.','x'), ('1','4','乘著掃把飛行的巫婆對於神聖屬性魔法的抵抗力很弱.','巫婆對於神聖屬性魔法很弱.','o'), ('1','5','礦山殭屍與殭屍比的話，殭屍的等級比較高','兩個的等級皆為 57','x'), ('1','6','飛行的蝙蝠就像飛鼠般的掛在天花板上.','不休息繼續飛行.','x'), ('1','7','就像在黃金海灘或熱帶沙灘可以看見的花蟹一樣，紅螃蟹偶爾會跳躍攻擊.','雖然長得像花蟹一樣但也會跳躍攻擊.','o'), ('1','8','藍獨角獅是會冰凍攻擊的怪物.','為冰凍屬性攻擊，弱點為不死屬性的怪物.','o'), ('1','9','長得像可愛的海龜一樣的烏龜有著強力的遠距離攻擊.','烏龜為遠距離攻擊型的怪物.','o'), ('1','100','赤龍為龍類怪物中唯一會遠距離攻擊的.','赤龍與冰龍皆會遠距離攻擊.','x'), ('1','101','主要棲息在沼地的黑鱷魚是比土龍等級還高的怪物.','黑鱷魚(等級 52), 土龍(等級 45).','o'), ('1','102','在勇士之村周圍可以看到土龍，他是龍的進化種，特徵為遠距離攻擊.','只能近距離攻擊無法遠距離攻擊.','x'), ('1','103','在冰原雪域登場的所有怪獸，對於火屬性魔法的抵抗力都很弱.','黑吉拉卡,黑企鵝對於神聖屬性很弱','x'), ('1','104','怪物短牙海豹若遭受攻擊的話會與頭上的小海豹分離，然後一起攻擊.','小海豹無法分離.','x'), ('1','105','等級 100的地獄巴洛古不會中毒魔法的毒.','特徵是會使毒魔法變得無效，但對神聖魔法很弱.','o'), ('1','106','乘著掃把飛行的巫婆是不死怪物.','巫婆雖然對神聖屬性魔法很弱，但是不是不死怪物','x'), ('1','107','吃了炸蝦道具後，狩獵活跳蝦會更容易抓到.','與炸蝦無關.','x'), ('1','108','斧木妖是樵夫沒有將斧頭拔出，所以含著恨而誕生的怪物.','傳說為樵夫把斧頭釘在上面後離開，所以含著恨而重新出生','o'), ('1','109','哈利波特和妙麗是男女朋友.','哈利波特和妙麗只是朋友.','x'), ('1','110','狼人若遭到攻擊會召喚自己的分身並攻擊.','狼人沒有分身','x'), ('1','111','在童話村登場的鬼怪中，綠色鬼怪可使用蕎麥蒟蒻來召喚.','綠色鬼怪 - 蕎麥蒟蒻','o'), ('1','112','在童話村登場的鬼怪中，藍色鬼怪可使用豬肉串來召喚.','藍色鬼怪 - 穀茶','x'), ('1','113','在童話村登場的鬼怪中，黃色鬼怪可使用穀茶來召喚.','黃色鬼怪 - 豬肉串','x'), ('1','114','楓之谷內最弱的怪物為 \'菇菇仔\'.','最弱的不是菇菇仔而是蝸牛.','x'), ('1','115','在動物森林中的狐狸與浣熊額頭貼著樹葉.','兩隻怪物皆在額頭貼著樹葉.','o'), ('1','116','抓住上海郊外的鴨子的話可獲得潛水鞋.','不是潛水鞋而是可獲得鴨蛋.','x'), ('1','117','英文APPLE的意思是柳丁.','APPLE的意思是蘋果.','x'), ('1','118','2014年世界杯冠軍是巴西隊.','巴西隊已經被淘汰囉.','x'), ('1','119','機器貓小叮噹最愛的食物是銅鑼燒. ','抓到山羊的話可獲得白羊角.','x'), ('1','120','人類的五官包括手.','五官是眉眼耳鼻口.','x'), ('2','1','村莊商店雖然有賣單邊銀色耳環但沒有賣紫水晶耳環.','紫水晶耳環可在弓箭手村商店中購買.','x'), ('2','2','在商店購買 100%卷軸時雙手武器卷軸比單手武器卷軸還貴.','雙手武器卷軸與單手武器卷軸的價錢一樣.','x'), ('2','3','魔法森林武器商店中只有販售長杖卷軸與短杖卷軸.','也有販售耳環用卷軸.','x'), ('2','100','炸蝦道具只能向水世界的雜貨商人安納斯購買.','其他地方沒有販售','o'), ('2','1