e.','冰上曲棍也稱作hat trick.','x'), ('8','105','世界著名的死海位於埃及.','死海位於約旦和巴勒斯坦交界.','x'), ('8','106','跨欄比賽中無論男女皆為 110m.','女子為 100m 男子為 110m.','x'), ('8','107','在足球中進行自由球時至少要距離對方踢球選手最少 9.15m 以上才行.','進入9.15m內的話會被警告.','o'), ('8','108','游泳被指定為奧運正式項目是在 1896年 第1屆奧運.','從1900年 第2屆奧運起被指定為正式項目.','x'), ('8','109','88首爾奧運中南韓獲得全體第 5名.','88首爾奧運中南韓獲得全體第 4名.','x');
